      <Route path='/' 
       element={<h1>Hello</h1>}/>
      <Route path='/dashboard' element={<Dashboard/>} />
      {/* <Route path='/loginForm' element={<LoginForm/>} /> */}
      {/* <Route path='/register' element={<Register/>} /> */}
    </Routes>

    </div>
  );
}

export default App
